		tween(HueMover, newtweeninfo(do_tween and menu["animation_speed"] or 0, Enum.EasingStyle.Sine, Enum.EasingDirection.In), {Position = udim2new(0, 0, clamp(hue2/360, 0, 0.99), 0)})
