		if tool then
			delay(0, onToolAdded, tool)
		end
	end)
	
	utility.newConnection(menu_references["material_tools"].onColorChange, function(color, transparency)
		if not flags["material_tools"] then
			return end

		local tool = lplr_data["tool"]
		if tool then
			delay(0, onToolAdded, tool)
		end
	end)
